import React from "react";


export class Searchbar extends React.Component {



    render() {

        return (
        <header className="searchbar">
            <form class="form">
                <button type="submit" class="button">
                    <span class="button-label">Search</span>
                </button>

                <input
                    class="input"
                    type="text"
                    autocomplete="off"
                    autofocus
                    placeholder="Search images and photos"
                />
            </form>
            </header>
        )
    }

}
